// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import InicioTurmas from './components/InicioTurmas';
import Form from './components/Form/Form';

function App() {
  return (
    <Router>
      <Routes>
        {/* Rota para o formulário de login */}
        <Route path="/login" element={<Form />} />
        {/* Rota para a página de início das turmas */}
        <Route path="/inicio-turmas" element={<InicioTurmas />} />
        {/* Rota padrão para redirecionar para o login */}
        <Route path="*" element={<Form />} />
      </Routes>
    </Router>
  );
}

export default App;
